import { defineMessages } from 'react-intl';

export const scope = 'app.containers.PreFooter';

export default defineMessages({
  thankYouMessage: {
    id: `${scope}.thankYouMessage`,
    defaultMessage: 'Thank you for supporting us!',
  },
  getInTouchMessage: {
    id: `${scope}.getInTouchMessage`,
    defaultMessage: 'Let us get in touch on any of these platforms.',
  },
});
